import { React, useState, useEffect } from "react";

const List = ({ items }) => {
  console.log(items);
  return (
    <div className="List">
      <p id="amount"> Amount of results</p>
      {items.map((item) => (
        <div key={item.company} className="Item">
          <button onClick={() => onClick(item)} className="OnMapBtn">
            On Map
          </button>
        </div>
      ))}
    </div>
  );
};

export default List;
